-- ----------------------------
--  Table structure for `yiyi_area`
-- ----------------------------
DROP TABLE IF EXISTS `yiyi_area`;
CREATE TABLE `yiyi_area` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `pid` int(10) unsigned NOT NULL DEFAULT '0',
  `name` varchar(50) NOT NULL DEFAULT '',
  `listorder` mediumint(8) unsigned NOT NULL DEFAULT '0',
  `switch` enum('false','true','del','delete') NOT NULL DEFAULT 'true' COMMENT '状态（0：禁用   1：启用   2：删除  3：彻底删除-回收站不可见）',
  `orderid` int(10) NOT NULL COMMENT '排列排序',
  `addtime` int(10) DEFAULT NULL COMMENT '公司状态，1省公司，2市公司，3分理处',
  `addadmin` int(10) unsigned NOT NULL,
  `uptime` int(10) NOT NULL,
  `upadmin` smallint(5) NOT NULL,
  `deltime` int(10) unsigned NOT NULL,
  `deladmin` smallint(5) unsigned NOT NULL,
  `sys` enum('true','false') NOT NULL DEFAULT 'false',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=3267 DEFAULT CHARSET=utf8;

