DROP TABLE IF EXISTS `yiyi_column`;
CREATE TABLE `yiyi_column` (
  `id` smallint(10) unsigned NOT NULL AUTO_INCREMENT,
  `siteid` smallint(5) unsigned NOT NULL DEFAULT '1' COMMENT '站点id',
  `attr` varchar(5) NOT NULL COMMENT '属性: 1：单页  2：列表 3:图文',
  `pid` smallint(5) unsigned NOT NULL COMMENT '栏目上级id',
  `title` varchar(30) NOT NULL COMMENT '栏目名称',
  `content` text NOT NULL COMMENT '内容',
  `url` varchar(255) NOT NULL COMMENT '跳转链接',
  `pic` varchar(100) NOT NULL COMMENT '缩略图片',
  `pic_arr` varchar(255) DEFAULT NULL,
